import React from "react";

function Footer() {
  const currentYear = new Date().getFullYear();

  return (
    <footer>
      <div className="footer" style={{ fontSize: "75px" }}>
        Footer {currentYear}
      </div>
    </footer>
  );
}

export default Footer;

